description:
Aleska Diamond is willing to do nearly anything to land a lead role in Jay's next ballet production. She stages a secret performance for him in the basement of his theatre. Once she has him all alone, Aleska shows off exactly what having the flexibility of a prima ballerina can do for your love life. Crazy splits, back-bends, the way Aleska stretches herself to take Jay's cock will having you coming back for more and more.


